import React, { Component } from "react";
import DanhSachSinhVien from "./DanhSachSinhVien/DanhSachSinhVien";
import { sinhVienServ } from "./SinhVienServ/sinhVienServ";

export default class AxiosQuanLySinhVien extends Component {
  state = {
    dssv: [],
  };
  componentDidMount() {
    sinhVienServ
      .layDanhSachSinhVIen()
      .then((res) => {
        console.log(res);
        this.setState({ dssv: res.data });
      })
      .catch((err) => {
        console.log(err);
      });
  }
  render() {
    return (
      <div>
        <p className="display-3 pt-2 text-center">Quản lý sinh viên</p>
        <DanhSachSinhVien dssv={this.state.dssv} />
      </div>
    );
  }
}
